import React,{useContext} from "react";
import "../styles/Navbar.css";
import flightContent from "../context/FlightContext";
import { Link } from "react-router-dom";
const Navbar = () => {
  const content = useContext(flightContent)
  const {departure,arrival,search} = content 

  return (
    <>
    <nav className="navbar navbar-expand-lg bg-light header">
      <div className="container-fluid">
        <div className="navbar-brand" >TV-flights</div>
        <div className={`${search === 'true'?'d-block':'d-none'}`}>
          <div className="search-display">
            <div className="place-con">
                <div className="s-d-item">{departure}</div>
                <div>-</div>
                <div className="s-d-item">{arrival}</div>
              </div>
              <div className="date-con">
                <div className="s-d-item">01 NOV</div>
              </div>
              <div className="pass-con">
                <div className="s-d-item">1 passenger</div>
              </div>
              <div className="modify-search-con">
                <div className="s-d-item" >Modify search</div>
            </div>
          </div>
        </div>
        <div className="h-auth">
            <Link to="/Login" className="h-auth-btn h-login">Login</Link>
            <Link to="/Register" className="h-auth-btn h-register">Register</Link>
        </div>
      </div>
    </nav>
    </>
  );
};

export default Navbar;
